/* Skin structure */

@import '../config/variables';
@import '../mixins/buttons';
@import '../mixins/breakpoints';

$link-color: $primary-color !default;

::-moz-selection {
    background-color: $primary-color;
}

::selection {
    background-color: $primary-color;
}

.bg-primary {
    background-color: $primary-color !important;
}

.bg-secondary {
    background-color: $secondary-color !important;
}

a {
    color: $link-color;
}

a:hover,
a:focus {
    color: darken($link-color, 10%);
}

.link-underline {
    box-shadow: 0 1px 0 0 $primary-color;
}

.text-primary {
    color: $primary-color !important;
}

.text-secondary {
    color: $secondary-color !important;
}

/* Elements */
.alert-primary {
    background-color: $primary-color;
}

.banner-badge {

    .banner-link:hover,
    .banner-link:focus {
        .banner-link-text {
            background-color: $primary-color;
        }
    }
}

.header-3,
.header-4 {
    .header-search-extended {
        .btn {
            background-color: transparent;
            color: #333;

            &:hover,
            &:focus {
                color: $primary-color;
            }
        }
    }
}

.btn-video {
    color: $primary-color;

    &:hover,
    &:focus {
        background-color: $secondary-color;
    }
}

.breadcrumb-item {
    a {

        &:hover,
        &:focus {
            color: $primary-color;
        }
    }
}

.btn-link {
    color: $primary-color;

    &:hover,
    &:focus,
    .btn-link-dark:hover,
    .btn-link-dark:focus {
        color: $primary-color;
        border-color: $primary-color;
    }
}

/* generated with mixins */
.btn-primary {
    @include button-variant(#fff, $primary-color, $primary-color, #fff, $secondary-color, $secondary-color);
}

.btn-secondary {
    @include button-variant(#fff, $secondary-color, $secondary-color, #fff, $primary-color, $primary-color);
}

.btn-white {
    @include button-variant(#333333, #fff, #fff, #fff, $primary-color, $primary-color);
}

.btn-white-2 {
    @include button-variant(#333333, #fff, #fff, #fff, $secondary-color, $secondary-color);
}

.btn-primary-white {
    @include button-variant(#fff, $primary-color, $primary-color, $primary-color, #fff, #fff);
}

.btn-white-primary {
    @include button-variant($primary-color, #fff, #fff, #fff, $primary-color, $primary-color);
}

.btn-dark {
    @include button-variant(#fff, #333, #333, #fff, $primary-color, $primary-color);
}

.btn-outline {
    @include button-outline-variant($primary-color, $primary-color,
    transparent, #ebebeb, #ebebeb,
    0 5px 10px rgba(0, 0, 0, .05), 0 5px 10px rgba(0, 0, 0, .15));
}

.btn-outline-primary {
    @include button-outline-variant($primary-color, $primary-color,
    transparent, $primary-color,
    #ebebeb,
    none, 0 5px 10px rgba(0, 0, 0, .05));
}

.btn-outline-primary-2 {
    @include button-outline-variant($primary-color, #fff,
    $primary-color, $primary-color,
    $primary-color,
    none, none);
}

.btn-outline-light {
    @include button-outline-variant(#fff, $primary-color,
    transparent, #fff, #fff,
    );
}

.btn-outline-dark {
    @include button-outline-variant(#333333, $primary-color,
    transparent, #d7d7d7,
    #ebebeb,
    none, 0 5px 10px rgba(0, 0, 0, .05));
}

.btn-outline-dark-2 {
    @include button-outline-variant(#333333, $primary-color,
    #fafafa, #ebebeb,
    #ebebeb,
    none, none);
}

.btn-outline-dark-3 {
    @include button-outline-variant(#333333, $primary-color,
    transparent, #d7d7d7,
    $primary-color,
    none, none);
}

.btn-outline-darker {
    @include button-outline-variant(#333333, #fff,
    $primary-color, #d7d7d7,
    $primary-color,
    none, none);
}

.btn-outline-gray {
    @include button-outline-variant(#333333, #fff,
    $primary-color, #959595,
    $primary-color,
    none, none);
}

.btn-outline-lightgray {
    @include button-outline-variant(#333333, $primary-color,
    #f5f6f9, #ebebeb,
    #ebebeb,
    none, none);
}

.btn-outline-white {
    @include button-outline-variant(#fff, #fff,
    $primary-color, #fff,
    $primary-color,
    none, none);
}

.btn-outline-white-2 {
    @include button-outline-variant(#fff, #fff,
    $secondary-color, #fff,
    $secondary-color,
    none, none);
}

.btn-outline-white-4 {
    @include button-outline-variant(
        #fff, $primary-color, 
        #fff, #fff, 
        #fff,
        none, none
    );
}

